style.css:
@-moz-document url-prefix("http://news.google."), url-prefix("https://news.google.") {

/* Globals */

/* Logo & Header */
* { color: #CCCCDD;  }
div#page-header { background: transparent !important; }
div#page-header img { display: none !important; }
div#page-header table tbody tr td { background: url(data:image/png;base64,) no-repeat !important; width: 160px; padding-top: 5px !important; }
img.jfk-button-img { display: none !important; }
div#settings-button { background: url(data:image/png;base64,) no-repeat !important; }
div#gbx1, div.kd-appbar { background: #44444d !important; }
div.kd-appbar { border-bottom: 1px solid #57575F !important; }
div#page-header table tbody tr td.search-in-header { background: none !important; }
div.main-appbar div, div.main-appbar div input { color: #333 !important; }
div.background { background: url('http://i.imgur.com/GfhvXhl.jpg?1') #44444d no-repeat fixed 165px; }

/* Left Nav */
span.sel { color: #2277DD !important; text-shadow: #111 1px 1px 2px;}
a.persistentblue { color: #DDDDEE !important; font-family: Calibri !important; font-size: 10pt; text-shadow: #111 1px 1px 2px; }
div.left-nav-pinned, div#left-nav-wrapper, div.nav-one-col-hp { background: #44444d !important; border-right: 1px solid #57575F; }

/* Main Content */
div.main-content-with-gutter-wrapper { border-left: 1px solid #222; }
div.basic-title { background: transparent !important; color: #CCCCDD; font-size: 12pt !important; border-bottom: 1px solid #DDD; }
div.basic-title a { color: #CCCCDD !important; text-decoration: none !important; }
div.blended-wrapper,div.blended-wrapper-first,div.story { background: transparent !important; }
span.titletext { color: #DDDDEE; font-size: 12pt !important; font-weight: normal !important; text-decoration: none !important; text-shadow: #111 1px 1px 2px; }
div.snippet { color: #CCCCDD; font-size: 11pt !important; text-shadow: #111 1px 1px 2px; }
div.story a { color: #2288DD !important; font-size: 10pt; }
div.story span.date { color: #22AA55 !important; }
div.story { font-family: Calibri !important; }
div.story div.thumbnail a img { outline: none !important; border: none !important; box-shadow: 0px 0px 5px #333; }

/* Main Content - Personalize section */
div#eqp-pane-wrapper, div.eqp-pane-inner, div.topic-autocomplete-wrapper, div.select-source-autocomplete-wrapper { background: #44444d !important; }
table.topic-list-row, table.suggest-topic-list-row { border: none !important; }
div#list-separator { display: none !important; }

/* Footer */
div.footer { background: #44444d !important; }
}
